import { ImageList, ImageListItem, Typography } from '@mui/material';
import * as React from 'react';
import { IconButton } from '@mui/material';
import DownloadIcon from '@mui/icons-material/Download';
import { useParams } from 'react-router-dom';

function DownloadButton(props:{url:string, name:string}) {
  const handleDownload = () => {
    // Logic for handling download
    const link = document.createElement('a');
    link.href = props.url;  // Replace with your file URL
    link.download = props.name;  // Specify the file name
    link.click();
  };

  return (
    <IconButton onClick={handleDownload} color="primary">
        Download
      <DownloadIcon />
    </IconButton>
  );
}
function ProjectContent( props:{image:any, title:string,explain:string, fileUrl:string }){
return <>
 <ImageList sx={{ width: 500, height: 450 }} cols={3} rowHeight={164}>
 <ImageListItem key={props.fileUrl}>
    <img
    src={props.image}
    alt={props.fileUrl}
    />
 </ImageListItem>
 </ImageList>
 <Typography variant="h1">
    {props.title}
 </Typography>
 <Typography variant="body1">
    {props.explain}
 </Typography>
 <DownloadButton url={props.fileUrl} name={props.title}/>
</>
}

